import React from 'react';

import './Filter.css';

function Filter() {
  return (
    <div className='filter'>
      <span className='filter__name'>Короткометражки</span>
      <label className='filter__container'>
        <input
          className='filter__input'
          type='checkbox'
        />
        <span className='filter__switch' />
      </label>
    </div>
  );
}

export default Filter;
